const UziCatalogList = ({ list }) => {
  return (
    <>
      {list.map(({ uzi }, index) => {
        return(
          <ul className="catalog__list mobile brend" key={index}>
            {uzi.map(({ link, img },index) => {
              return(
                <li key={index} className="catalog__item uzi brend" data-aos="zoom-in" data-aos-duration="700">
                  <a href={link} className="catalog__item-pict uzi brend" rel="noreferrer">{img}</a>
                  <a href={link} className="catalog__item-link uzi brend" rel="noreferrer">подробнее</a>
                </li>
              )
            })}
          </ul>
        )
      })}
    </>
  )
}

export default UziCatalogList
